import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { ContactService } from './services/contact.service';
import { Contact } from './models/contact';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [CommonModule, FormsModule],
  templateUrl: './app.component.html',
  styleUrl: './app.component.css'
})
export class AppComponent implements OnInit {
  contacts: Contact[] = [];
  selectedContact: Contact = {
    name: '',
    address: '',
    telephone: '',
    mobile: '',
    email: '',
    country: ''
  };

  constructor(private contactService: ContactService) {}

  ngOnInit(): void {
    this.loadContacts();
  }

  loadContacts(): void {
    this.contactService.getContacts().subscribe(contacts => {
      this.contacts = contacts;
    });
  }

  newContact(): void {
    this.selectedContact = {
      name: '',
      address: '',
      telephone: '',
      mobile: '',
      email: '',
      country: ''
    };
    alert("New contact form cleared");
  }

  save(): void {
    if (!this.selectedContact.name || !this.selectedContact.address) {
      alert("Please fill in required fields");
      return;
    }

    this.contactService.addContact(this.selectedContact).subscribe({
      next: (newContact) => {
        this.contacts.push(newContact);
        this.newContact();
        alert("Contact saved successfully");
      },
      error: (err) => {
        console.error('Error saving contact:', err);
        alert("Error saving contact");
      }
    });
  }

  selectContact(contact: Contact): void {
    this.selectedContact = { ...contact };
  }

  update(): void {
    if (!this.selectedContact.id) {
      alert("No contact selected for update");
      return;
    }

    this.contactService.updateContact(this.selectedContact.id, this.selectedContact).subscribe({
      next: (updatedContact) => {
        const index = this.contacts.findIndex(c => c.id === updatedContact.id);
        if (index !== -1) {
          this.contacts[index] = updatedContact;
        }
        alert("Contact updated successfully");
      },
      error: (err) => {
        console.error('Error updating contact:', err);
        alert("Error updating contact");
      }
    });
  }

  delete(): void {
    if (!this.selectedContact.id) {
      alert("No contact selected for deletion");
      return;
    }

    if (confirm("Are you sure you want to delete this contact?")) {
      this.contactService.deleteContact(this.selectedContact.id).subscribe({
        next: () => {
          this.contacts = this.contacts.filter(c => c.id !== this.selectedContact.id);
          this.newContact();
          alert("Contact deleted successfully");
        },
        error: (err) => {
          console.error('Error deleting contact:', err);
          alert("Error deleting contact");
        }
      });
    }
  }
}
<div class="container mt-4">
    <h3>Contact Information</h3>

    <input type="hidden" [(ngModel)]="selectedContact.id" />

    <div class="mb-2">
        <input id="Name" 
               class="form-control" 
               placeholder="Name"
               [(ngModel)]="selectedContact.name" />
    </div>

    <div class="mb-2">
        <input id="Address" 
               class="form-control" 
               placeholder="Address"
               [(ngModel)]="selectedContact.address" />
    </div>

    <div class="mb-2">
        <input id="Email" 
               class="form-control" 
               placeholder="Email"
               [(ngModel)]="selectedContact.email" />
    </div>

    <div class="mb-2 row">
        <div class="col-md-6">
            <input id="Telephone" 
                   class="form-control" 
                   placeholder="Telephone"
                   [(ngModel)]="selectedContact.telephone">
        </div>

        <div class="col-md-6">
            <input id="Mobile" 
                   class="form-control" 
                   placeholder="Mobile"
                   [(ngModel)]="selectedContact.mobile">
        </div>
    </div>

    <div class="mb-2 row">
        <div class="col-md-6">
            <select id="Country" 
                    class="form-control"
                    [(ngModel)]="selectedContact.country">
                <option value="">-- Select Country --</option>
                <option value="Sri Lanka">Sri Lanka</option>
                <option value="India">India</option>
                <option value="United States">United States</option>
                <option value="United Kingdom">United Kingdom</option>
                <option value="Australia">Australia</option>
            </select>
        </div>
    </div>

    <button class="btn btn-light" style="border: 1px solid #dee2e6;" (click)="newContact()">New</button>
    <button class="btn btn-light" style="border: 1px solid #dee2e6;" (click)="save()">Save</button>
    <button class="btn btn-light" style="border: 1px solid #dee2e6;" (click)="update()" [disabled]="!selectedContact.id">Update</button>
    <button class="btn btn-light" style="border: 1px solid #dee2e6;" (click)="delete()" [disabled]="!selectedContact.id">Delete</button>

    <hr />

    <table class="table table-bordered">
        <thead>
            <tr>
                <th>Name</th>
                <th>Address</th>
                <th>Telephone</th>
                <th>Mobile</th>
                <th>Email</th>
                <th>Country</th>
                <th>Actions</th>
            </tr>
        </thead>
        <tbody id="tbl">
            <tr *ngFor="let contact of contacts">
                <td>{{ contact.name }}</td>
                <td>{{ contact.address }}</td>
                <td>{{ contact.telephone }}</td>
                <td>{{ contact.mobile }}</td>
                <td>{{ contact.email }}</td>
                <td>{{ contact.country }}</td>
                <td>
                    <button class="btn btn-sm btn-light" style="border: 1px solid #dee2e6;" (click)="selectContact(contact)">Edit</button>
                </td>
            </tr>
        </tbody>
    </table>
</div>
